static const SymsRegInfo * reg_table_from_arch(SymsArch arch)
{
	switch (arch) {
	case SYMS_ARCH_NULL: return g_syms_regdesc_NULL; break;
	case SYMS_ARCH_ARM: return g_syms_regdesc_ARM; break;
	case SYMS_ARCH_ARM32: return g_syms_regdesc_ARM32; break;
	case SYMS_ARCH_PPC: return g_syms_regdesc_PPC; break;
	case SYMS_ARCH_PPC64: return g_syms_regdesc_PPC64; break;
	case SYMS_ARCH_IA64: return g_syms_regdesc_IA64; break;
	case SYMS_ARCH_X64: return g_syms_regdesc_X64; break;
	case SYMS_ARCH_X86: return g_syms_regdesc_X86; break;
	default: break;
	}
	return g_syms_regdesc_NULL;
}
static syms_uint reg_table_size_from_arch(SymsArch arch)
{
	switch (arch) {
	case SYMS_ARCH_NULL: return g_syms_regdesc_NULL_size; break;
	case SYMS_ARCH_ARM: return g_syms_regdesc_ARM_size; break;
	case SYMS_ARCH_ARM32: return g_syms_regdesc_ARM32_size; break;
	case SYMS_ARCH_PPC: return g_syms_regdesc_PPC_size; break;
	case SYMS_ARCH_PPC64: return g_syms_regdesc_PPC64_size; break;
	case SYMS_ARCH_IA64: return g_syms_regdesc_IA64_size; break;
	case SYMS_ARCH_X64: return g_syms_regdesc_X64_size; break;
	case SYMS_ARCH_X86: return g_syms_regdesc_X86_size; break;
	default: break;
	}
	return 0;
}

